import { Router, Link } from '@reach/router';

const NavBar = () => {
  return <div className="navbar">
    <Router>
      <Link to="/"><h3>Home</h3></Link>
      <h3>Topics</h3>
      <p>topic 1</p>
      <p>topic 2</p>
      <h3>View all articles</h3>
    </Router>
    <h3>Add new article</h3>
  </div>
}

export default NavBar;
